(' KMC Solutions, Inc.', '', '-', '-', '-', '2018', 'kmcsolutions@gmail.com', '-', 'Customer Service/Relations, Sales - Corporate, Telesales/Telemarketing', 'Batangas', 'J.P. Laurel St.', '4231', 'Balaytigue', '09123456789', '<p>We are the largest Philippines-based Flexible Office Solutions Provider in the country. KMC Solutions is an ISO-Certified Outsourcing, Staff Leasing, and Office Solutions provider in the Philippines. From building out facilities, providing serviced offices, complying with legal and business requirements down to human resources, KMCS offers a full suite of services, designed to help companies outsource to the Philippines or enter and expand in the country.</p><p>KMC is an ISO-Certified provider of Flexible Workspace Solutions and Staff Leasing services in the Philippines. We have the country\'s largest network of serviced offices and coworking space, with facilities across Metro Manila, Cebu, Clark, and Iloilo. Headquartered in Bonifacio Global City (BGC), KMC delivers effective business solutions through the seamless integration of services, together with sister companies KMC Savills, the country\'s top real estate services firm and Kittleson &amp; Carpo Consulting, a business consultancy firm.<br></p>', , '<div><p>We are committed to providing premium office spaces and high-performing offshore teams for both Filipino and Multinational companies. KMC started out with only 2 floors in a single building, now we have the largest collection of coworking spaces in the Philippines with 54 floors across 24 buildings. We are proud to be trusted by some of the most innovative startups &amp; partners and established global brands when it comes to doing business in the Philippines.</p><p><br></p></div>', '<div><p>We are dedicated to delivering customer-centric, highly flexible office space solutions to businesses seeking to establish their business operations and grow in the Philippines.</p><p>From building out facilities or providing private spaces in serviced offices, to comply with legal and business requirements, even down to human resources and payroll management. KMC offers a full suite of services that are designed to help companies outsource a team or enter and expand operations in the Philippines.</p></div>', '200+', '01-05-2023 09:05 PM [PST +08:00]', 'employer', 'kmcsolutions.com', '25d55ad283aa400af464c76d713c07ad', 'CM758439462', '');
